import React from 'react';
import logo from './logo.svg';
import './App.css';

function App() {
  return (


    <div className="App">
      <header className="App-header">
      <link rel="stylesheet" href="/App.css"/>
        <p>

          Edit <code>src/App.js</code> and save to reload.
        </p>


      </header>
    </div>
  );
}

export default App;
